import React from "react";
import bg from "./background.jpg";
import "./App.css";
// import Control from './components/control';
// import Time from './components/time';
import TimePicker from 'react-time-picker';

class App extends React.Component {
  state = {
    time: "10:00",
  };

  onChange = (time) => this.setState({ time });

  render() {
    return (
      <div className="text-black relative ">
        <div className=" bg-black h-screen absolute top-0">
          <img src={bg} className="bg-cover h-full h-full opacity-25 top-0" />
        </div>
        <div className="container mx-auto py-10  relative">
          <h1 className="text-4xl text-center text-gray-100	uppercase font-mono ">
            Thi trắc nghiệm bằng lái xe A1
          </h1>
        </div>
        <div className=" container mx-auto w-full relative py-16">
          <div className="  px-8 flex flex-wrap flex-column justify-between items-center">
            <div>
              <p className="text-white">Hello</p>
            </div>
            <div className=" px-16 py-4">
              <p className="text-white">
                <TimePicker onChange={this.onChange} value={this.state.time} />
              </p>
            </div>
          </div>
        </div>
        <div className="flex  container w-full mx-auto relative justify-between">
          <div className=" bg-green-500 w-4/12">oremloremloremlorem</div>
          <div className="bg-black w-7/12 flex flex-col">
            <div className=" bg-green-500">aaaaa</div>
            <div className=" bg-black">aaas</div>
          </div>
        </div>
      </div>
    );
  }
}
export default App;
